export default function WorkHistoryContainer(props) {
    let counter = 1
    return(<ul className="workHistory">
        {props.projects.map(project => {
            if(counter%2===0){
                counter++;
                return <li className="project-even">
                    {project}
                </li>;
            } else {
                counter++;
                return <li className="project-odd">{project}</li>;
            }
        })}
    </ul>);
}
